import Navbar from '../components/Navbar';
import ImageList from '@mui/material/ImageList';
import ImageListItem from '@mui/material/ImageListItem';
import Footer from '../components/Footer';
import { Grid } from '@mui/material';

const itemData = [
  {
    img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
    title: 'Breakfast',
  },
  {
    img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d',
    title: 'Burger',
  },
  {
    img: 'https://images.unsplash.com/photo-1522770179533-24471fcdba45',
    title: 'Camera',
  },
  {
    img: 'https://images.unsplash.com/photo-1444418776041-9c7e33cc5a9c',
    title: 'Coffee',
  },
  {
    img: 'https://images.unsplash.com/photo-1533827432537-70133748f5c8',
    title: 'Hats',
  },
  {
    img: 'https://images.unsplash.com/photo-1558642452-9d2a7deb7f62',
    title: 'Honey',
  },
];

export default function Projects() {
  return (
    <Grid container rowSpacing={14} justifyContent="center">
  <Grid item xs={12}>
    <Navbar />
  </Grid>
  <Grid item xs={9}>
  <div class="filter-projects">
        <button>sinalização</button>
        <button>identidade visual</button>
        <button>editorial</button>
        <button>todos</button>
      </div>
  </Grid>
  <Grid item xs={9} justifyContent="center">
  <ImageList gap={20} cols={3}>
          {itemData.map((item) => (
            <ImageListItem key={item.img} sx={{ cursor: 'pointer' }}>
              <img
                srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                alt={item.title}
                loading="lazy"
              />
            </ImageListItem>
          ))}
        </ImageList>
  </Grid>
  <Grid xs={12}>
  <Footer />
  </Grid>
</Grid>
  )
}
